	class Cryptage {

		static private $char;
		static private $tableau             = false;
		static private $brouillagesOrders   = false;
		static private $defaultKey          = false;
		static private $mathSecure          = false;

		public static function init($brouillagesOrders, $defaultKey, $char, $mathSecure){
			if (!is_array(self::$brouillagesOrders)){
				self::$brouillagesOrders    = $brouillagesOrders;
				self::$defaultKey           = $defaultKey;
				self::$char                 = $char;
				self::$mathSecure           = $mathSecure;
				self::creationtableau();
			}
		}

		public static function crypt($chaine, $key = false){
			$key = !$key ? self::$defaultKey : $key;
			$n = array_rand(self::$brouillagesOrders);
			$numberOne = rand(10000, 99999);
			$numberTwo = rand(10000, 99999);
			$result = self::generateSecure($numberOne, $numberTwo, $n);
			$chaine .= $numberOne. $numberTwo. $result;
			$ordre = self::resizeOrders(self::$brouillagesOrders[$n], strlen($chaine));
			$chaine = strlen($n) < 2 ? $chaine. "0". $n : $chaine. $n;
			$crypt = self::encodage(self::debrouillage($chaine, $ordre), $key);
			return $crypt;
		}

		public static function decrypt($jeton, $key = false){
			$key = !$key ? self::$defaultKey : $key;
			$desencode = self::desencodage($jeton, $key);
			$n = intval(substr($desencode, -2));
			$ordre = self::resizeOrders(self::$brouillagesOrders[$n], strlen($jeton)-2);
			$jeton = self::debrouillage(self::desencodage($jeton, $key), self::Inverse($ordre));
			preg_match("/(.*)([0-9]{5})([0-9]{5})([0-9]{5})([0-9]{2})$/", $jeton, $infos);
			if (count($infos) == 6){
				$result = self::generateSecure($infos[2], $infos[3], $infos[5]);
				if ($infos[4] == $result){
					return $infos[1];
				}
			}
		}

		private static function generateSecure($numberOne, $numberTwo, $order){
			$n = substr($order, -1);
			$calculs = self::$mathSecure[$n];
			foreach ($calculs as $calcul) {
				switch ($calcul) {
					case "-":
						$numberOne -= $numberTwo;
						break;
					case "+":
						$numberOne += $numberTwo;
						break;
					case "*":
						$numberOne *= $numberTwo;
						break;
					default:
						$numberOne = $numberOne / $numberTwo;
						break;
				}
			}
			$numberOne = $numberOne < 0 ? $numberOne * (-1) : $numberOne;
			while(strlen($numberOne) < 5) { $numberOne = "0". $numberOne;}
			preg_match("#([0-9]{5})#", $numberOne, $five);
			return $five[1];
		}

		private static function resizeOrders($orders, $max){
			$resized = array();
			foreach ($orders as $n) {
				if($n < $max){
					$resized[] = $n;
					if(count($resized) == $max){
						return $resized;
					}
				}
			}
		}

		private static function debrouillage($chaine, $ordre){
			$charsChaine = str_split($chaine);
			$chaine = "";
			foreach($charsChaine as $k => $v){
				if($k < count($charsChaine) - 2){
					$chaine .= $charsChaine[$ordre[$k]];
				} else {
					$chaine .= $v;
				}
			}
			return $chaine;
		}

		private static function Inverse($tableau){
			$tab = array();
			$tableau = array_flip($tableau);
			$j = count($tableau);
			for($i = 0; $i != $j; $i++){
				$tab[$i] = $tableau[$i];
			}
			return $tab;
		}

		private static function encodage($chaine, $cle){
			$chaine = str_split($chaine);
			$cle = str_split($cle);
			$retour = "";
			$o = 0;
			$maxCle = count($cle);
			foreach($chaine as $value){
				$retour .=  self::$tableau[$cle[$o]][array_search($value, self::$char)];
				$o++;
				if($o == $maxCle) $o = 0;
			}
			return $retour;
		}

		private static function desencodage($jeton, $key){
			$jeton = str_split($jeton);
			$key = str_split($key);
			$retour = "";
			$o = 0;
			$maxKey = count($key);
			foreach($jeton as $value){
				$retour .=  self::$char[array_search($value, self::$tableau[$key[$o]])];
				$o++;
				if($o == $maxKey){
					$o = 0;
				}
			}
			return $retour;
		}

		private static function creationTableau(){
			$tableau = self::$char;
			$tableau_retour = array();
			for($i = 0; $i <= count($tableau); $i++){
				self::$tableau[$tableau[0]] = $tableau;
				$tableau[] = $tableau[0];
				unset($tableau[0]);
				$tableau = array_merge($tableau);
			}
		}

